import React, { Component } from 'react';
class About extends Component {
    render() {
        return (
        <div className="frontpage">
            <h1 className="subtopic">About</h1>
            <h4>Hi!,</h4>
            <h1>I'm Ása Júlía Aðalsteinsdóttir</h1>
            <h3>Web Developer | UI/UX Designer</h3>
            <br></br>
            <p> Currently, I'm studying Web Communications at the University of Iceland.
                I graduated from the University of Iceland with a B.Sc in Computer Science.
                Now my interest are mostly web development as well as UX design.
                I started knitting last year and I can't stop. Last year, I took some
                pottery courses which I enjoy alot.
            </p>
        </div>
        )
    }
}
export default About
